snippet.textDisplay:
@Pro Gamer Cara, tem muita conspiração e desinformação no seu comentário, recomendo que veja as lives do Atila.
O vírus não é uma "jogada de marketing". É algo sério e já afeta muitos outros países além de China. O problema é que, ao contrário da gripe, ele interna muitas pessoas e os hospitais não tem estrutura para internar tantas pessoas, por isso estão tentando reduzir ao máximo a propagação, para dar tempo de quem está no hospital desocupar a vaga e libera-la para outra pessoa.
E já estão trabalhando em "cura" sim. Na verdade essa palavra "cura" é muito forte. Estão pesquisando vacinas para prevenção e antivirais para tratar quem já está doente.

